var newsIsotoper = (function ($) {
    'use strict';
    var pub = {};

    /**
     * Instantiate
     */
    pub.init = function (options) {

        $(window).on('load', function () {
            registerEventHandlers();
            registerBootEventHandlers();
        });
    };
    var button = 'filter-all';
    var button_class = "btn-primary";
    var button_normal = "btn-quaternary";
    function check_button(button){
      $('.filter-link').removeClass(button_class);
      $('.filter-link').addClass(button_normal);
      $('#'+button).addClass(button_class);
      $('#'+button).removeClass(button_normal);
    }

    function load_content() {
      var $container = $("#news-content-isotoper .view-content");

      $container.imagesLoaded(function(){

        $container.masonry({
          columnWidth: '.switch-elements',
        });

        /*$container.infinitescroll({
          state : {
            currPage: 0
          },
          // selector for the paged navigation
          navSelector  : '.pagination',
          // selector for the NEXT link (to page 2)
          nextSelector : '.pagination li.next a',
          // selector for all items you'll retrieve
          itemSelector : '.switch-elements',
          loading: {
            //finishedMsg: 'Der er ikke flere.',
            //img: 'http://i.imgur.com/qkKy8.gif'
          },
          debug: false,
        },
        function(newElements) {
          var $newElems = $(newElements).hide();
          $newElems.imagesLoaded(function(){
            $newElems.fadeIn(); // fade in when ready
            $container.masonry( 'appended', $newElems);
            Drupal.attachBehaviors();
          });
            /*setTimeout(function() {
              $container.masonry( 'insert', $newElems);
            }, 500);
        }
        );*/
      });
    }
    /**
     * Register event handlers
     */
    function registerEventHandlers() {

      var $container = $("#news-content-isotoper .view-content");
      check_button(button);

      // filter buttons.
      $('.filter-link').click(function(event){
        $(this).addClass(button_class);
        button = $(this).attr('id');
        check_button(button);
        var filterValue = $( this ).attr('data-filter');
        jQuery.get("/aktulet_news/ajax/view/"+filterValue+'/'+20, function(data){
          $('#news-content-isotoper').html(data);
          load_content();
        });
      });

      $container = $("#news-content-isotoper .view-content");

      // Initial masonry
      if ($container.length) {
        load_content();
      }


    };
    function registerBootEventHandlers() {

    }

  return pub;

})( jQuery );
// |--------------------------------------------------------------------------
// | Equal height
// |--------------------------------------------------------------------------
// |
// | This jQuery script is written by
// | Morten Nissen
// |
var equalHeight = (function ($) {
    'use strict';
    var pub = {};

    /**
     * Instantiate
     */
    pub.init = function (options) {

        $(window).on('load', function () {
            registerEventHandlers();
            registerBootEventHandlers();
        });
    };

    /**
     * Register event handlers
     */
    function registerEventHandlers() {

        $(window).resize(function () {
            setEqualHeights();
        });
    }

    /**
     * Register boot event handlers
     */
    function registerBootEventHandlers() {
        setEqualHeights();
    }

    function setEqualHeights() {

        $('.os2-equal-height-wrapper').each(function() {
            var $wrapper = $(this);
            var $elements = $wrapper.find('.os2-equal-height-element');
            var tallestElementHeight = 0;

            $elements.each(function() {
                var $element = $(this);
                var elementHeight = $element.outerHeight();

                if (elementHeight > tallestElementHeight) {
                    tallestElementHeight = elementHeight;
                }
            });

            $elements.css('min-height', tallestElementHeight);
        });
    }

    return pub;
})(jQuery);

// Document ready
(function ($) {
  'use strict';

  // Enable BS3 designer
  bs3Designer.init();

  // Enable BS3 sidebar
  bs3Sidebar.init();

  // Enable popover button
  popoverButton.init();

  // Self-service toggle
  equalHeight.init();

  // Self-service toggle
  os2SelfServiceToggle.init();

  // Accordion
  os2Accordion.init();

  // News
  newsIsotoper.init();

  // Megamenu
  toggleMegamenu();

  function toggleMegamenu() {
    var $toggle = $('.js-megamenu-toggle');
    var default_zone_menu_height = jQuery('#toplevelmenu').outerHeight();
    $('.megamenu-panel').each(function() {
      $('<a></a>').attr('href', '#').addClass('js-megamenu-close').appendTo(this);
    });

    $toggle.on('click', function(event) {
      event.preventDefault();

      var $parent = $(this).parents('.megamenu'),
          $megamenu = $parent.find('.megamenu-panel');
     // var megamenu_height =$megamenu.height();
      if (!$parent.hasClass('open')){
        //$('#toplevelmenu').animate({'height' : default_zone_menu_height + megamenu_height});
        jQuery('.megamenu-panel').hide();

        var $megamenu = $parent.find('.megamenu-panel');
        $megamenu.show();
        var megamenu_height = $parent.find('.megamenu-panel').height();
        $megamenu.addClass('clearfix');
        jQuery('#toplevelmenu').height(default_zone_menu_height + megamenu_height);
        jQuery('.megamenu').not($parent).removeClass('open');
        $parent.addClass('open');
      }
     });

    $('.js-megamenu-close').on('click', function(event){
      event.preventDefault();
      var $parent = $(this).closest('.megamenu');
      if($parent.hasClass('open')){
        $parent.removeClass('open');
        $('#toplevelmenu').height(default_zone_menu_height);
        $('.megamenu-panel').hide();
      }
    });
  }
})(jQuery);

